class ReinCard{constructor(i,s){this.id=i.id,this.el=$(`#${this.id}`),this.itemId=i.itemId,this.itemNm=i.itemNm,this.summary=i.summary,this.list=i.list,this.i=i.i,this.render()}render(){const i=this.summary.map(i=>`\n            <div class="r-card-list">\n                <div class="col-4">${i.a}</div>\n                <div class="col-4">${i.s} 성공</div>\n                <div class="col-4">${i.f} 실패</div>\n            </div>\n        `).join(""),s=this.list.map(i=>`\n            <li>\n                <div class="w55">${i.date}</div>\n                <div class="w20 ta-center">${i.before} > ${i.after}</div>\n                <div class="w25 ta-center ${i.result?'color-success"> 성공':'color-fail">실패'}</div>\n                ${i.ticket?`<div class="w100">* ${i.ticket}</div>`:""}\n            </li>\n        `).join(""),t=`\n          <div class="card mb-2">\n            <div class="card-header">\n                <img class="setImg" src="https://img-api.neople.co.kr/df/items/${this.itemId}" />\n                ${this.itemNm}\n            </div>\n            ${i}\n            <div id="ls_${this.id}_${this.i}" class="card-header fold-reinforce">상세 이력</div>\n            ${this.list.length>0?`<ul id="ul_${this.id}_${this.i}" class="list-group">`:""}\n              ${s}\n            ${this.list.length>0?"</ul>":""}\n          </div>`;this.el.append(t),$(`#ls_${this.id}_${this.i}`).click(i=>{$(i.target).hasClass("open")?($(i.target).removeClass("open"),$(`#ul_${this.id}_${this.i}`).removeClass("show")):($(i.target).addClass("open"),$(`#ul_${this.id}_${this.i}`).addClass("show"))})}}